/**
 * Get icon for programming language/file extension
 */
export function getIconForLanguageExtension(language: string) {
  const lang = language.toLowerCase().replace(/^\./, "")

  switch (lang) {
    case "ts":
    case "tsx":
    case "typescript":
      return <Icons.typescript className="fill-foreground" />
    case "py":
    case "python":
      return <Icons.python className="fill-foreground" />
    case "rs":
    case "rust":
      return <Icons.rust className="fill-foreground" />
    case "r":
      return <Icons.r className="fill-foreground" />
    default:
      return <FileIcon />
  }
}

/**
 * Icon name type - union of all icon names
 */
export type IconName = keyof typeof Icons

/**
 * Get all icon names
 */
export function getAllIconNames(): string[] {
  return Object.keys(Icons)
}

/**
 * Icon count helper
 */
export function getIconCount(): number {
  return Object.keys(Icons).length
}

